import { useSelector } from "react-redux";
import { NavLink } from "react-router-dom";
import "./NavBar.style.css";
// import logo from "./sluzba-logo.png";
import { GetPages } from "../../helpers/GetStates";

const NavBar = () => {
  const pages = useSelector((state) => state.pages.pages);
  return (
    <div className="navbar">
      <div>
        {/* <img src={logo} alt="logo" /> */}
        <img />
        <span>Aplikacija za praÄ‡enje projekata</span>
      </div>
      <NavLink exact to="/" activeClassName="navactive">
        Pocetna
        {/* <span></span> */}
      </NavLink>
      {/* <NavLink to="/cities" activeClassName="navactive">
        Gradovi
      </NavLink> */}
      {/* <NavLink to="/users" activeClassName="navactive">
        Korisnici
      </NavLink> */}
      {/* <NavLink to="/projects" activeClassName="navactive">
        Projekti
      </NavLink>
      <NavLink to="/table" activeClassName="navactive">
        Table
      </NavLink> */}
      {pages.map((page) => {
        return (
          <NavLink
            key={page.key}
            exact
            to={`/${page.key}`}
            activeClassName="navactive"
          >
            {page.name}
          </NavLink>
        );
      })}
      {pages.map((page) => {
        if (page.table) {
          return (
            <NavLink
              key={page.key}
              exact
              to={`/${page.key}/table`}
              activeClassName="navactive"
            >
              Tabela {page.name}
            </NavLink>
          );
        }
        return null;
      })}
    </div>
  );
};

export default NavBar;
